    true,nt"url": null,nt"notes": "<ol start="2007">n<li>Centers for Disease
    Control and Prevention (CDC). Best Practices for Comprehensive Tobacco Control Programs.
    Funding. CDC's Best Practices for Comprehensive Tobacco Control Programs is an evidence-based
    guide to help states plan and establish effective tobacco control programs to prevent
    and reduce tobacco use.  Data are reported at total and per capita funding levels.
    Data include recommended, upper, and lower total funding levels for state programs,
    in addition to funding breakdowns by intervention areas such as: State and Community
    Interventions, Health Communication Interventions, Cessation Interventions, Surveillance
    and Evaluation, and Administration and Management.</li>n</ol>n",nt"license_title":
